robot_angry_face_frames = [framebuf.FrameBuffer(buf, 128, 64, framebuf.MONO_HLSB) for buf in robot_angry_face]
robot_happy_face_frames = [framebuf.FrameBuffer(buf, 128, 64, framebuf.MONO_HLSB) for buf in robot_happy_face]

def show_robot_face():
    prev_state = False
    curr_state = False
    while True:
        if selector_pin.value() == 1:
            prev_state = curr_state
            if signal_pin.value() == 1:
                pixel[0] = (0, 255, 0)
                pixel.write()
                for i in range(len(robot_happy_face)):
                    if signal_pin.value() == 0:
                        break
                    if selector_pin.value() == 0:
                        curr_state = False
                    else:
                        curr_state = True
                    if curr_state != prev_state:
                        break
                    oled.fill(0)  # Limpiar la pantalla
                    oled.blit(robot_happy_face_frames[i], 0, 0)  # Dibujar la imagen
                    oled.show()  # Actualizar el display
                    utime.sleep_ms(10)
            else:
                pixel[0] = (255, 0, 0)
                pixel.write()
                for i in range(len(robot_angry_face)):
                    if signal_pin.value() == 1:
                        break
                    if selector_pin.value() == 1:
                        curr_state = False
                    else:
                        curr_state = True
                    if curr_state != prev_state:
                        break
                    oled.fill(0)  # Limpiar la pantalla
                    oled.blit(robot_angry_face_frames[i], 0, 0)  # Dibujar la imagen
                    oled.show()  # Actualizar el display
                    utime.sleep_ms(10)
        elif selector_pin.value() == 0:
            if signal_pin.value() == 1:
                pixel[0] = (0, 255, 0)
                pixel.write()
                show_measurements(s1, s2)
                time.sleep(0.1)
            else:
                pixel[0] = (255, 0, 0)
                pixel.write()
                oled.fill(0)
                oled.text("NO V5 Signal", 18, 30)
                oled.show()
        else:
            oled.fill(0)
            oled.show()

_thread.start_new_thread(show_robot_face, ())

def show_measurements(s1, s2):
    oled.fill(0)  # Limpiar la pantalla
    
    oled.text("S1:".format(s1), 54, 10)
    oled.text((str(s1)), 50, 20)
    oled.text("S2:".format(s1), 54, 30)
    oled.text((str(s2)), 50, 40)
    if uart_sndn:
        oled.text("Enviando...", 25, 57)
    oled.show()  # Actualizar la pantalla

try:
    print("Now setting up device 1")
    # Re-enable device 1 - on the same bus
    device_1_xshut.value(1)
    utime.sleep_us(TBOOT)

    tofl1 = setup_tofl_device(i2c_1, 40000, 12, 8)

    while True:
        if signal_pin.value() == 1:
            # Intentar enviar datos por UART
            try:
                s1 = tofl0.ping()
                s2 = tofl1.ping()
                uart1.write("{}, {}\n".format(s1, s2).encode())
                uart_sndn = True
            except Exception as e:
                uart_sndn = False
                oled.fill(0)
                oled.text("Error en UART", 0, 0)
                oled.show()  # Mostrar error en la OLED
        
        time.sleep(0.1)  # Esperar un segundo antes de la prxima lectura
finally:
    # Restore default address
    print("Restoring")
    tofl0.set_address(0x29)
